import React from 'react'
import { useState } from 'react'

function MiniExample() {

    const [count, setCount] = useState(0)

    return (
        <div>
            <h1>
                {count}
            </h1>

            <h1 onClick = {() => setCount(count + 2) } >
                Add
            </h1>
            <h1 onClick = {() => setCount(count-2)}>
                Minus
            </h1>
        </div>
    )
}

export default MiniExample
